                            faq_q_2: "\u0427\u0442\u043e \u0442\u0430\u043a\u043e\u0435 \u0434\u0443\u0431\u043b\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435?",
                            faq_a_2: "\u0414\u0443\u0431\u043b\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435, \u044d\u0442\u043e \u0442\u043e \u0436\u0435 \u0441\u0430\u043c\u043e\u0435, \u0447\u0442\u043e \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435 \u043c\u043d\u043e\u0436\u0438\u0442\u0435\u043b\u044f 2\u0445, \u043e\u0434\u043d\u0430\u043a\u043e \u0432 \u0441\u043b\u0443\u0447\u0430\u0435 \u0432\u0430\u0448\u0435\u0439 \u043f\u043e\u0431\u0435\u0434\u044b \u0432\u044b \u043f\u043e\u043b\u0443\u0447\u0430\u0435\u0442\u0435 \u0432\u0430\u0448 \u043e\u0440\u0438\u0433\u0438\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u0442\u043e\u0432\u0430\u0440 \u0438 \u0435\u0433\u043e \u043a\u043e\u043f\u0438\u044e (\u0438\u043b\u0438 \u043f\u043e\u0445\u043e\u0436\u0438\u0439 \u0442\u043e\u0432\u0430\u0440, \u0435\u0441\u043b\u0438 \u0443 \u043d\u0430\u0441 \u043d\u0435\u0442 \u0432\u044b\u0431\u0440\u0430\u043d\u043d\u043e\u0433\u043e \u0432\u0430\u043c\u0438 \u0442\u043e\u0432\u0430\u0440\u0430).",
                            faq_q_3: "\u042f \u0441\u043b\u0443\u0447\u0430\u0439\u043d\u043e \u0447\u0442\u043e-\u0442\u043e \u0443\u043b\u0443\u0447\u0448\u0438\u043b. \u042f \u043d\u0435 \u0445\u043e\u0442\u0435\u043b \u0443\u043b\u0443\u0447\u0448\u0430\u0442\u044c \u0435\u0433\u043e, \u043d\u043e \u043c\u043e\u0439 \u0434\u0440\u0443\u0433, \u043f\u0430\u043f\u0430, \u043c\u0430\u043c\u0430, \u0431\u0440\u0430\u0442 \u0438\u043b\u0438 \u0441\u043e\u0431\u0430\u043a\u0430 \u043d\u0430\u0436\u0430\u043b\u0438 \u043a\u043d\u043e\u043f\u043a\u0443 \u0443\u043b\u0443\u0447\u0448\u0435\u043d\u0438\u044f \u0432\u043c\u0435\u0441\u0442\u043e \u043c\u0435\u043d\u044f.",
                            faq_a_3: "\u041c\u044b \u043d\u0435 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0438\u043c \u0432\u043e\u0437\u0432\u0440\u0430\u0442 \u0441\u043b\u0443\u0447\u0430\u0439\u043d\u044b\u0445 \u0443\u043b\u0443\u0447\u0448\u0435\u043d\u0438\u0439. \u0422\u043e\u043b\u044c\u043a\u043e \u0432\u044b \u043d\u0435\u0441\u0435\u0442\u0435 \u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u0437\u0430 \u0432\u0430\u0448\u0443 \u0443\u0447\u0435\u0442\u043d\u0443\u044e \u0437\u0430\u043f\u0438\u0441\u044c.",
                            faq_q_4: "\u042f \u043d\u0435 \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u0432\u044b\u0432\u0435\u0434\u0435\u043d\u043d\u044b\u0439 \u0442\u043e\u0432\u0430\u0440, \u0445\u043e\u0442\u044f \u043f\u0440\u043e\u0448\u043b\u043e \u0443\u0436\u0435 \u0431\u043e\u043b\u0435\u0435 30 \u043c\u0438\u043d\u0443\u0442.",
                            faq_a_4: "\u041f\u043e\u0436\u0430\u043b\u0443\u0439\u0441\u0442\u0430, \u043e\u0442\u043a\u0440\u043e\u0439\u0442\u0435 \u043e\u0431\u0440\u0430\u0449\u0435\u043d\u0438\u0435 \u0432 \u0441\u043b\u0443\u0436\u0431\u0443 \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0438, \u0443\u043a\u0430\u0437\u0430\u0432 ID-\u043d\u043e\u043c\u0435\u0440 \u0432\u0430\u0448\u0435\u0439 \u0441\u0434\u0435\u043b\u043a\u0438. \u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u043d\u0430\u0439\u0442\u0438 \u043d\u043e\u043c\u0435\u0440 \u0441\u0434\u0435\u043b\u043a\u0438, \u043d\u0430\u0436\u0430\u0432 \u043d\u0430 \u043a\u043d\u043e\u043f\u043a\u0443 \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u044f \u0441\u0434\u0435\u043b\u043a\u0438 \u0432 \u0432\u0435\u0440\u0445\u043d\u0435\u0439 \u0447\u0430\u0441\u0442\u0438 \u044d\u043a\u0440\u0430\u043d\u0430.",
